// src/components/LayoutWithoutNavbar.js
import React from 'react';
import Footer from './Footer';

const LayoutWithoutNavbar = ({ children }) => {
  return (
    <div className="layout">
      <main>{children}</main>
      <Footer />
    </div>
  );
};

export default LayoutWithoutNavbar;
